# 查询所有被变更的概念
SELECT DISTINCT ?name ?link
WHERE { 
    ?s a/rdfs:subClassOf* clog:SchematicConcept;
       rdfs:label ?name.
    OPTIONAL {
        ?s clog:link ?link.
    }
}
```

