}
```

```sparql
# 查询所有被变更的属性集
SELECT DISTINCT ?name ?link
WHERE { 
    ?s a/rdfs:subClassOf* clog:SchematicConcept;
       rdfs:label ?name.
    OPTIONAL {
        ?s clog:link ?link.
    }
    FILTER (STRSTARTS(?name, "Pset_") || STRSTARTS(?name, "Qto_"))
}
```

```sparql
# 查询每个被变更的概念的变更总数
SELECT ?name (COUNT(DISTINCT ?change) AS ?count)
WHERE { 
    ?change a/rdfs:subClassOf+ clog:BaseChange.
    ?concept a clog:SchematicConcept;
        clog:hasChange ?change;
        rdfs:label ?name.
}
GROUP BY ?name
ORDER BY DESC(?count)
```
